import Error from "./Error";
const App = () => {
  return (
    <>
      <Navbar />
      <Switch>
        <Route exact path="/" component={About} />
        <Route exact path="/search" component={Search} />
        <Route component={Error} />
      </Switch>
      {/* <h1>Hello </h1>
